import React from "react";
import "./css/famHistory.css";

const FamHistory = () => {
  return (
    <div className="famHistory">
      <div className="first__content__left">one</div>
      <div className="first__content__right">two</div>
      <div className="second__content__left">three</div>
      <div className="second__content__right">four</div>
    </div>
  );
};

export default FamHistory;
